<!DOCTYPE html>

<head>
    <title>Ejercicio 11 - Problema 1</title>
</head>
<body>
    
    <script>    
        let i=1;
        while(i!=25){
            document.write(i+""+i+" - ");
            i++;
        }
        document.write(i+""+i);
    </script>
</body>
